import{_ as s,C as e,c as _,o as c,b1 as d,G as i}from"./chunks/framework.CC7vnuC4.js";const h=JSON.parse('{"title":"变量","description":"","frontmatter":{"breadcrumbs":[{"title":"Continue Project","link":"/AuraSkills"},{"title":"变量","link":"/AuraSkills/placeholders"}]},"headers":[],"relativePath":"AuraSkills/placeholders.md","filePath":"AuraSkills/placeholders.md"}'),r={name:"AuraSkills/placeholders.md"};function u(t,l,k,n,p,m){const a=e("NolebaseGitContributors"),o=e("NolebaseGitChangelog");return c(),_("div",null,[l[0]||(l[0]=d('<h1 id="变量" tabindex="-1">变量 <a class="header-anchor" href="#变量" aria-label="Permalink to &quot;变量&quot;">​</a></h1><p>PlaceholderAPI 变量列表</p><p>AuraSkills 提供了开箱即用的 PlaceholderAPI，无需下载变量拓展。因插件 2.0 版本后的改名，现存以 <code>%aureliumskills_%</code> 开头的变量仍然会与 <code>%auraskills_</code> 一并生效。但是，你应当将变量逐渐更换为 <code>%auraskills_</code>，旧版变量有可能在未来随时移除。</p><h2 id="列表" tabindex="-1">列表 <a class="header-anchor" href="#列表" aria-label="Permalink to &quot;列表&quot;">​</a></h2><ul><li><code>%auraskills_power%</code> - 综合技能等级。</li><li><code>%auraskills_[技能名称]%</code> - 指定技能等级（示例；<code>%aureliumskills_farming%</code>）。</li><li><code>%auraskills_[技能名称]_roman%</code> - 罗马数字格式显示的指定技能等级。</li><li><code>%auraskills_[属性名称]%</code> - 指定属性等级（如：<code>%aureliumskills_health%</code>）</li><li><code>%auraskills_[属性名称]_int%</code> - 指定属性等级，取整显示。</li><li><code>%auraskills_average%</code> - 平均技能等级。</li><li><code>%auraskills_average_int%</code> - 平均技能等级，取整显示。</li><li><code>%auraskills_average_1%</code> - 平均技能等级，取一位小数显示。</li><li><code>%auraskills_hp%</code> - 取整显示的血量。</li><li><code>%auraskills_hp_1%</code> - 取一位小数显示的血量。</li><li><code>%auraskills_hp_2%</code> - 取两位小数显示的血量。</li><li><code>%auraskills_hp_max%</code> - 血量上限。</li><li><code>%auraskills_hp_percent%</code> - 取整显示的生命值百分比。</li><li><code>%auraskills_mana%</code> - 当前玩家魔力值。</li><li><code>%auraskills_mana_int%</code> - 取整显示当前玩家魔力值。</li><li><code>%auraskills_lb_power_[名次]%</code> - 指定排名综合技能等级及对应玩家名称。</li><li><code>%auraskills_lb_power_[名次]_name%</code> - 指定排名综合技能等级对应玩家名称。</li><li><code>%auraskills_lb_power_[名次]_value%</code> - 指定排名综合技能等级数值。</li><li><code>%auraskills_lb_[技能名称]_[名次]%</code> - 指定排名技能等级及对应玩家名称。</li><li><code>%auraskills_lb_[技能名称]_[名次]_name%</code> - 指定排名技能等级对应玩家名称。</li><li><code>%auraskills_lb_[技能名称]_[名次]_value%</code> - 指定排名技能等级数值。</li><li><code>%auraskills_rank%</code> - 获取综合技能排行榜头衔。</li><li><code>%auraskills_rank_[技能名称]%</code> - 获取指定技能排行榜头衔。</li><li><code>%auraskills_xp_required_formatted_[技能名称]%</code> - 获取指定技能下一级所需经验缩写（示例：5k）</li><li><code>%auraskills_xp_required_[技能名称]%</code> - 获取指定技能下一级所需经验实际数值</li><li><code>%auraskills_xp_progress_int_[技能名称]%</code> - 获取当前等级升级进度整数百分比。</li><li><code>%auraskills_xp_progress_1_[技能名称]%</code> - 获取当前等级升级进度一位小数百分比。</li><li><code>%auraskills_xp_progress_[技能名称]%</code> - 获取当前等级升级进度百分比。</li><li><code>%auraskills_xp_int_[技能名称]%</code> - 获取玩家当前经验数。</li><li><code>%auraskills_xp_formatted_[技能名称]%</code> - 获取玩家当前缩写经验数。</li><li><code>%auraskills_xp_[技能名称]%</code> - 获取玩家当前经验实际数值。</li><li><code>%auraskills_multiplier%</code> - 获取玩家权限经验倍率，取两位小数。（1 = 无倍率，2 = 双倍经验）</li><li><code>%auraskills_multiplier_[技能名称]%</code> - 获取玩家指定技能的权限经验倍率，取两位小数。（1 = 无倍率，2 = 双倍经验）</li><li><code>%auraskills_multiplier_percent%</code> - 获取玩家指定技能的权限经验倍率，取额外部分的百分比。（40 = 40% 额外经验加成）</li><li><code>%auraskills_multiplier_percent_[技能名称]%</code> - 获取玩家指定技能的权限经验倍率，取额外部分的百分比整数。（40 = 40% 额外经验加成）</li><li><code>%auraskills_actionbar_status%</code> - 获取玩家 ActionBar 的开关状态。根据情况返回 true 或 false。</li><li><code>%auraskills_[能力名称]%</code> - 获取能力等级。将 <code>[能力名称]</code> 替换为能力的英文小写原名。</li><li><code>%auraskills_[能力名称]_roman%</code> - 获取罗马数字的能力等级。</li><li><code>%auraskills_[能力名称]_value%</code> - 获取能力的数值。</li><li><code>%auraskills_[能力名称]_value_int%</code> - 获取能力整数数值。</li><li><code>%auraskills_[能力名称]_value_2%</code> - 若存在，获取能力次级数值。</li><li><code>%auraskills_[能力名称]_value_2_int%</code> - 若存在，获取能力整数次级数值。</li><li><code>%auraskills_mability_[能力名称]%</code> - 获取魔法能力等级。</li><li><code>%auraskills_mability_[能力名称]_roman%</code> - 获取罗马数字的魔法能力等级。</li><li><code>%auraskills_mability_[能力名称]_value%</code> - 获取魔法能力的数值。</li><li><code>%auraskills_mability_[能力名称]_value_int%</code> - 获取魔法能力整数数值。</li><li><code>%auraskills_mability_[能力名称]_active%</code> - 返回指定魔法能力是否激活。若有则返回 true，反之返回 false。</li><li><code>%auraskills_trait_[特征名称]%</code> - 获取指定特征的有效等级。</li><li><code>%auraskills_trait_[特征名称]_bonus%</code> - 获取指定特征的额外等级（含基础数值）。</li><li><code>%auraskills_trait_[特征名称]_menu%</code> - 返回与属性界面中格式相同的特征。</li><li><code>%auraskills_jobs_list%</code> - 列出所有可用职业的小写英文名，以逗号分隔。</li><li><code>%auraskills_jobs_list_formatted%</code> - 列出所有可用职业对应 <code>default_language</code> 语言的本地化名称，以逗号分隔。</li><li><code>%auraskills_jobs_count%</code> - 返回玩家当前拥有的职业数量。</li><li><code>%auraskills_jobs_limit%</code> - 返回玩家最多拥有的职业数量。</li><li><code>%auraskills_jobs_active_[技能名称]%</code> - 根据指定职业激活情况返回 true 或 false。（示例：<code>%auraskills_jobs_active_farming%</code>）</li></ul>',5)),i(a),i(o)])}const f=s(r,[["render",u]]);export{h as __pageData,f as default};
